import React, { useState } from 'react';
import "./SignUp.css";
import axios from 'axios';

const SignUpForm = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [showInterestForm, setShowInterestForm] = useState(false);
  const [selectedInterests, setSelectedInterests] = useState([]);

  const handleUsernameChange = (e) => {
    setUsername(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSignUp = (e) => {
    e.preventDefault();
    setShowInterestForm(true);
  };

  const handleInterestChange = (e) => {
    const { value } = e.target;
    setSelectedInterests((prevInterests) => {
      if (prevInterests.includes(value)) {
        return prevInterests.filter((interest) => interest !== value);
      } else {
        return [...prevInterests, value];
      }
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const userData = {
      username: username,
      password: password,
      interests: selectedInterests
    };

    axios.defaults.headers.post['Content-Type'] = 'application/json';

    axios.post("http://localhost:5000/signup", userData)
      .then(response => {
        console.log(response.data);
        // Perform any necessary actions after successful submission
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div className='signup'>
      <div className='logo'>
        <h1>Sign In to Twitter</h1>
        {!showInterestForm ? (
          <form onSubmit={handleSignUp}>
            <div>
              <label htmlFor="username">Username:</label>
              <input
                type="text"
                id="username"
                value={username}
                onChange={handleUsernameChange}
              />
            </div>
            <div>
              <label htmlFor="password">Password:</label>
              <input
                type="password"
                id="password"
                value={password}
                onChange={handlePasswordChange}
              />
            </div>
            <button type="submit">Sign Up</button>
          </form>
        ) : (
          <form onSubmit={handleSubmit}>
            <div>
              <label htmlFor="interests">Select your interests:</label>
              <div>
                <label>
                  <input
                    type="checkbox"
                    value="interest1"
                    checked={selectedInterests.includes("interest1")}
                    onChange={handleInterestChange}
                  />
                  Interest 1
                </label>
              </div>
              <div>
                <label>
                  <input
                    type="checkbox"
                    value="interest2"
                    checked={selectedInterests.includes("interest2")}
                    onChange={handleInterestChange}
                  />
                  Interest 2
                </label>
              </div>
              {/* Add more interest options as needed */}
            </div>
            <button type="submit">Sign Up</button>
          </form>
        )}
      </div>
    </div>
  );
};

export default SignUpForm;
